import './App.css';
import Header from './Components/Header/Header.js';
import RouteFinder from './Components/RouteFinder/RouteFinder.js';
import ReservationInfo from './Components/Reservation/ReservationInfo.js';

function App() {
  return (
    <div className="App">
      <Routes>
        <Route path="/" element={<RouteFinder />} />
        <Route path="/reservation" element={<ReservationInfo />} />
        </Routes>
    </div>
  );
}

export default App;
